pub fn find_pat(end: u64, prob: f64, tab: &[(u64, u64)]) -> Option<u64> {
    let mut start = 2;
    let p = prob;
    loop {
        let mut prev_pat: Option<u64> = None;
        let mut collision = false;
        for n in 2..end {
            let x = prime_pat(n, tab);
            let y = prime_prod(x).unwrap_or(0);
            if y != 0 {
                if n != y {
                    collision = true;
                    prev_pat = match prev_pat {
                        Some(prev_pat) => {
                            if rand::random::<f64>() < p {
                                let z = refine_pat(n, x);
                                match pack_pat(z, prev_pat) {
                                    Some(x) => Some(x),
                                    None => break,
                                }
                            } else {continue}
                        }
                        None => {
                            Some(refine_pat(n, x))
                        }
                    };
                }
            };
            if !collision && n > start {
                start = n;
                // println!("start {}", start);
            };
        }

        if let Some(prev_pat) = prev_pat {
            if !tab.iter().any(|n| n.0 == prev_pat) {
                // println!("({}, {}),", prev_pat, prime_prod(prev_pat).unwrap());
                return Some(prev_pat)
            } else {
                continue;
            }
        }
        return None;
    }
}

pub fn prime_prod(pat: u64) -> Option<u64> {
    if pat == !0 {return None};
    let mut prod: u64 = 1;
    for i in 0..64_u64 {
        prod = prod.checked_mul(if (pat >> i) & 1 == 1 {nth_prime_with_lookup(i)} else {1})?;
    }
    Some(prod)
}

/// Packs two bit patterns together.
pub fn pack_pat(a: u64, b: u64) -> Option<u64> {
    let res = a | b;
    if prime_prod(res).is_none() {None} else {Some(res)}
}

pub fn refine_pat(n: u64, mut pat: u64) -> u64 {
    for i in 0..64 {
        if (pat >> i) & 1 == 1 {
            if n % nth_prime_with_lookup(i) != 0 {
                pat &= !(1 << i);
            }
        }
    }
    pat
}

pub fn prime_pat(i: u64, tab: &[(u64, u64)]) -> u64 {
    let mut pat: u64 = !0;
    for p in tab {
        if p.1 % i == 0 {
            pat &= p.0;
        }
    }
    pat
}

